  false,\n\t\"url\": null,\n\t\"notes\": \"This project will concentrate comprehensive
  search and control efforts on shiny geranium (Geranium lucidum). Approximately 3
  acres of oak woodland edge habitat (found in 2012) and 2 acres of young cottonwood
  forest edge habitat (found in 2013) are known to be infected on the Refuge. All
  potential habitats will be searched refuge-wide - estimated at approximately 20-40
  acres. The plant will be searched and treated on 3 acres of oak woodland and 2 acres
  of sandy soil deciduous riparian and other locations as discovered using EDRR.\",\n\t\"owner_org\":
